\u0435\u0432\u0430", "\u041d\u0430\u043b\u0438\u0447\u0438\u0435 \u0431\u0435\u0437\u0431\u0430\u0440\u044c\u0435\u0440\u043d\u043e\u0439 \u0441\u0440\u0435\u0434\u044b": "\u0414\u043e\u0441\u0442\u0443\u043f\u043d\u044b\u0439 \u0432\u0445\u043e\u0434 \u0434\u043b\u044f \u043b\u044e\u0434\u0435\u0439 \u0441 \u0438\u043d\u0432\u0430\u043b\u0438\u0434\u043d\u043e\u0441\u0442\u044c\u044e\n\u0411\u0435\u0441\u043f\u043b\u0430\u0442\u043d\u0430\u044f \u041f\u0430\u0440\u043a\u043e\u0432\u043a\u0430 50 \u043c\u0435\u0441\u0442", "\u041e\u043f\u0438\u0441\u0430\u043d\u0438\u0435": "\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435 \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0435 \u042f\u043a\u0443\u0442\u0441\u043a\u0438\u0439 \u0437\u043e\u043e\u043f\u0430\u0440\u043a \u2014 \u0437\u043e\u043e\u043b\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u043f\u0430\u0440\u043a \u0432 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0435 \u0421\u0430\u0445\u0430. \u0415\u0434\u0438\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0432 \u043c\u0438\u0440\u0435 \u0437\u043e\u043e\u043f\u0430\u0440\u043a, \u0440\u0430\u0431\u043e\u0442\u0430\u044e\u0449\u0438\u0439 \u0432 \u0443\u0441\u043b\u043e\u0432\u0438\u044f\u0445 \u0441\u0435\u0432\u0435\u0440\u043d\u043e\u0433\u043e \u044d\u043a\u0441\u0442\u0440\u0435\u043c\u0430\u043b\u044c\u043d\u043e \u0445\u043e\u043b\u043e\u0434\u043d\u043e\u0433\u043e \u043a\u043b\u0438\u043c\u0430\u0442\u0430. \u041e\u0441\u043e\u0431\u0435\u043d\u043d\u043e\u0441\u0442\u044c\u044e \u0437\u043e\u043e\u043f\u0430\u0440\u043a\u0430 \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0442\u0430\u043a\u0436\u0435 \u0438 \u0442\u043e, \u0447\u0442\u043e \u0443 \u043d\u0435\u0433\u043e \u0438\u043c\u0435\u0435\u0442\u0441\u044f \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e\u0441\u0442\u044c \u043f\u0440\u0438\u043d\u044f\u0442\u044c \u043b\u044e\u0431\u043e\u0435 \u0434\u0438\u043a\u043e\u0435 \u0436\u0438\u0432\u043e\u0442\u043d\u043e\u0435 \u0438 \u043e\u043a\u0430\u0437\u0430\u0442\u044c \u0435\u043c\u0443 \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u0443\u044e \u043f\u043e\u043c\u043e\u0449\u044c.", "\u041f\u043e\u0434\u0442\u0432\u0435\u0440\u0436\u0434\u0435\u043d\u0438\u0435 \u043a\u043e\u0440\u0440\u0435\u043a\u0442\u043d\u043e\u0441\u0442\u0438": true, "\u041f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044c, \u0432\u043d\u0435\u0441\u0448\u0438\u0439 \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u0435": "user__operator21032024", "\u041f\u0440\u0438\u043c\u0435\u0447\u0430\u043d\u0438\u0435": null, "\u0421\u0442\u043e\u0438\u043c\u043e\u0441\u0442\u044c \u0443\u0441\u043b\u0443\u0433": "\u0412\u0437\u0440\u043e\u0441\u043b\u044b\u0439 \u0431\u0438\u043b\u0435\u0442 \u2014 400 \u0440\u0443\u0431.,\n\u0414\u0435\u0442\u0441\u043a\u0438\u0439 \u0431\u0438\u043b\u0435\u0442 \u2014 350 \u0440\u0443\u0431\n\u041f\u0435\u043d\u0441\u0438\u043e\u043d\u0435\u0440\u0430\u043c - 300 \u0440\u0443\u0431\n\u0414\u0435\u0442\u0438 \u0434\u043e 5 \u043b\u0435\u0442, \u0413\u0435\u0440\u043e\u044f\u043c \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u0421\u043e\u044e\u0437\u0430 \u0438 \u0413\u0435\u0440\u043e\u044f\u043c \u0420\u043e\u0441\u0441\u0438\u0438, \u0413\u0435\u0440\u043e\u044f\u043c \u0421\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0442\u0440\u0443\u0434\u0430, \u0432\u0435\u0442\u0435\u0440\u0430\u043d\u0430\u043c \u0438 \u0438\u043d\u0432\u0430\u043b\u0438\u0434\u0430\u043c \u0412\u041e\u0412, \u0438\u043d\u0432\u0430\u043b\u0438\u0434\u0430\u043c \u0442\u0440\u0443\u0434\u0430, \u0434\u0435\u0442\u044f\u043c \u0438\u043d\u0432\u0430\u043b\u0438\u0434\u0430\u043c, \u0434\u0435\u0442\u044f\u043c \u0441\u043f\u0435\u0446\u0448\u043a\u043e\u043b \u0438 \u0434\u0435\u0442\u0441\u043a\u0438\u0445 \u0434\u043e\u043c\u043e\u0432. \u2014 \u0431\u0435\u0441\u043f\u043b\u0430\u0442\u043d\u043e.\n\u041e\u0440\u0433\u0430\u043d\u0438\u0437\u043e\u0432\u0430\u043d\u043d\u044b\u043c \u0433\u0440\u0443\u043f\u043f\u0430\u043c \u0441\u0442\u0440\u043e\u0433\u043e \u043f\u043e \u043f\u0440\u0435\u0434\u0432\u0430\u0440\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0439 \u0437\u0430\u044f\u0432\u043a\u0435 \u0432\u0437\u0440\u043e\u0441\u043b\u044b\u0439 350 \u0434\u0435\u0442\u0441\u043a\u0438\u0439 300", "\u0422\u0435\u043b\u0435\u0444\u043e\u043d": "8(4112) 22-52-59 (\u043e\u0444\u0438\u0441), 8(914) 2706-356 (\u0434\u0435\u0436\u0443\u0440\u043d\u044b\u0439 \u0430\u0434\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u0430\u0442\u043e\u0440)", "\u042d\u043b\u0435\u043a\u0442\u0440\u043e\u043d\u043d\u0430\u044f \u043f\u043e\u0447\u0442\u0430": "zoo_ykt_ortodoidu@mail.ru"}, "type": "Feature"}, {"geometry": {"coordinates": [129.71786111111112, 62.033211111111115], "type": "Point"}, "id": 353, "properties": {"\u0410\u0434\u0440\u0435\u0441 \u043c\u0435\u0441\u0442\u043e\u043d\u0430\u0445\u043e\u0436\u0434\u0435\u043d\u0438\u044f": "\u0433. \u042f\u043a\u0443\u0442\u0441\u043a, \u0443\u043b. \u041a\u0438\u0440\u043e\u0432\u0430, 31, \u0422\u0426 \u0425\u043e\u043c\u0443\u0441, 3 \u044d\u0442\u0430\u0436, 8(4112)36-17-92, 8(4112)42-86-75, \u044d\u043b. \u0430\u0434\u0440\u0435\u0441: micxnm@gov14.ru", "\u0412\u043d\u0443\u0442\u0440\u0435\u043d\u043d\u0438\u0439 \u0438\u0434\u0435\u043d\u0442\u0438\u0444\u0438\u043a\u0430\u0442\u043e\u0440": 353, "\u0412\u0440\u0435\u043c\u044f \u0440\u0430\u0431\u043e\u0442\u044b (\u043f\u043e\u0441\u0435\u0449\u0435\u043d\u0438\u0439)": "\u0411\u0443\u0434\u043d\u0438\u0435 \u0434\u043d\u0438- 09:00-18:00\n(\u043e\u0431\u0435\u0434 13:00-14:00)\n\u0421\u0443\u0431\u0431\u043e\u0442\u0430- 10:00-17:30\n(\u043e\u0431\u0435\u0434 13:00-13:30)\n\u0412\u043e\u0441\u043a\u0440\u0435\u0441\u0435\u043d\u044c\u0435- \u0432\u044b\u0445\u043e\u0434\u043d\u043e\u0439", "\u0413\u043b\u043e\u0431\u0430\u043b\u044c\u043d\u044b\u0439 \u0438\u0434\u0435\u043d\u0442\u0438\u0444\u0438\u043a\u0430\u0442\u043e\u0440 \u043e\u0431\u044a\u0435\u043a\u0442\u0430": "TOUR-ATTR-353", "\u0414\u0430\u0442\u0430 \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f": "2024-04-02T04:42:56Z", "\u0414\u043e\u0441\u0442\u0443\u043f\u043d\u043e\u0441\u0442\u044c \u0434\u043b\u044f \u043f\u043e\u0441\u0435\u0449\u0435\u043d\u0438\u044f \u0442\u0443\u0440\u0438\u0441\u0442\u0430\u043c\u0438": "\u041a\u0440\u0443\u0433\u043b\u044b\u0439 \u0433\u043e\u0434, \u043d\u0430\u0445\u043e\u0434\u0438\u0442\u0441\u044f \u0432 \u0446\u0435\u043d\u0442\u0440\u0435 \u0433\u043e\u0440\u043e\u0434\u0430", "\u041a\u0430\u0442\u0435\u0433\u043e\u0440\u0438\u044f": "\u041a\u0443\u043b\u044c\u0442\u0443\u0440\u043d\u044b\u0439, \u043f\u043e\u0437\u043d\u0430\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u0439", "\u041c\u0443\u043d\u0438\u0446\u0438\u043f\u0430\u043b\u044c\u043d\u044b\u0439 \u0440\u0430\u0439\u043e\u043d": "\u0413\u043e\u0440\u043e\u0434\u0441\u043a\u043e\u0439 \u043e\u043a\u0440\u0443\u0433 \u00ab\u0433\u043e\u0440\u043e\u0434 \u042f\u043a\u0443\u0442\u0441\u043a\u00bb", "\u041d\u0430\u0438\u043c\u0435\u043d\u043e\u0432\u0430\u043d\u0438\u0435": "\u0413\u0411\u0423 \u0420\u0421(\u042f) \"\u041c\u0443\u0437\u0435\u0439 \u0438 \u0446\u0435\u043d\u0442\u0440 \u0445\u043e\u043c\u0443\u0441\u0430 \u043d\u0430\u0440\u043e\u0434\u043e\u0432 \u043c\u0438\u0440\u0430\"", "\u041d\u0430\u043b\u0438\u0447\u0438\u0435 \u0431\u0435\u0437\u0431\u0430\u0440\u044c\u0435\u0440\u043d\u043e\u0439 \u0441\u0440\u0435\u0434\u044b": "\u0411\u0435\u0441\u043f\u043b\u0430\u0442\u043d\u0430\u044f \u043f\u0430\u0440\u043a\u043e\u0432\u043a\u0430 25 \u043c\u0435\u0441\u0442", "\u041e\u043f\u0438\u0441\u0430\u043d\u0438\u0435": "\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435 \u0431\u044e\u0434\u0436\u0435\u0442\u043d\u043e\u0435 \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0435 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438 \u0421\u0430\u0445\u0430 (\u042f\u043a\u0443\u0442\u0438\u044f) \u00ab\u041c\u0443\u0437\u0435\u0439 \u0438 \u0426\u0435\u043d\u0442\u0440 \u0445\u043e\u043c\u0443\u0441\u0430 \u043d\u0430\u0440\u043e\u0434\u043e\u0432 \u043c\u0438\u0440\u0430\u00bb \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0447\u043b\u0435\u043d\u043e\u043c \u041c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u043e\u0433\u043e \u0421\u043e\u0432\u0435\u0442\u0430 \u043c\u0443\u0437\u0435\u0435\u0432 (ICOM) \u043f\u0440\u0438 \u042e\u041d\u0415\u0421\u041a\u041e \u0438 \u0438\u043c\u0435\u0435\u0442 \u21161984-\u0420\u0423 \u0432 \u043a\u0430\u0442\u0430\u043b\u043e\u0433\u0435 \u0443\u043d\u0438\u043a\u0430\u043b\u044c\u043d\u044b\u0445 \u043c\u0443\u0437\u0435\u0435\u0432 \u043c\u0438\u0440\u0430. \u041d\u0430 \u0441\u0435\u0433\u043e\u0434\u043d\u044f \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0435 \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0435\u0434\u0438\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u043c \u0432 \u043c\u0438\u0440\u0435 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u043c \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0435\u043c \u043d\u0430 \u043f\u043e\u0441\u0442\u043e\u044f\u043d\u043d\u043e\u0439 \u043e\u0441\u043d\u043e\u0432\u0435 \u0437\u0430\u043d\u0438\u043c\u0430\u044e\u0449\u0435\u0439\u0441\u044f \u0441\u043e\u0445\u0440\u0430\u043d\u0435\u043d\u0438\u0435\u043c, \u0438\u0437\u0443\u0447\u0435\u043d\u0438\u0435\u043c \u0438 \u043f\u043e\u043f\u0443\u043b\u044f\u0440\u0438\u0437\u0430\u0446\u0438\u0435\u0439 \u0445\u043e\u043c\u0443\u0441\u0430 (\u0432\u0430\u0440\u0433\u0430\u043d\u0430) \u043d\u0430\u0440\u043e\u0434\u043e\u0432 \u043c\u0438\u0440\u0430.", "\u041f\u043e\u0434\u0442\u0432\u0435\u0440\u0436\u0434\u0435\u043d\u0438\u0435 \u043a\u043e\u0440\u0440\u0435\u043a\u0442\u043d\u043e\u0441\u 40\u0435\u0441\u0435\u043d\u044c\u0435 \u0441 10\u044700\u043c \u0434\u043e 17\u044700\u043c. \u041e\u0431\u0435\u0434\u0435\u043d\u043d\u044b\u0439 \u043f\u0435\u0440\u0435\u0440\u044b\u0432 \u0441 13\u044700\u043c \u0434\u043e 14\u044700\u043c, \u0432\u044b\u0445\u043e\u0434\u043d\u044b\u0435 - \u0441\u0431, \u0432\u0441", "\u041e\u043f\u0438\u0441\u0430\u043d\u0438\u0435": null, "\u041f\u043e\u0434\u0442\u0432\u0435\u0440\u0436\u0434\u0435\u043d\u0438\u0435 \u043a\u043e\u0440\u0440\u0435\u043a\u0442\u043d\u043e\u0441\u0442\u0438": false, "\u041f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044c, \u0432\u043d\u0435\u0441\u0448\u0438\u0439 \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u0435": null, "\u041f\u0440\u0438\u043c\u0435\u0447\u0430\u043d\u0438\u0435": "\u0421\u0442\u043e\u0438\u043c\u043e\u0441\u0442\u044c \u0432\u0445\u043e\u0434\u043d\u044b\u0445 \u0431\u0438\u043b\u0435\u0442\u043e\u0432:\n\u0412\u0437\u0440\u043e\u0441\u043b\u044b\u0435-200 \u0440\u0443\u0431.\n\u0428\u043a\u043e\u043b\u044c\u043d\u0438\u043a\u0438-100 \u0440\u0443\u0431.\n\u0414\u043e\u0448\u043a\u043e\u043b\u044c\u043d\u0438\u043a\u0438-\u0431\u0435\u0441\u043f\u043b\u0430\u0442\u043d\u043e\n\u0424\u043e\u0442\u043e\u0433\u0440\u0430\u0444\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u0435-100 \u0440\u0443\u0431.\n\u0412\u0438\u0434\u0435\u043e\u0441\u044a\u0435\u043c\u043a\u0430-300 \u0440\u0443\u0431.\n \n\u0414\u043b\u044f \u043c\u043d\u043e\u0433\u043e\u0434\u0435\u0442\u043d\u044b\u0445 \u0441\u0435\u043c\u0435\u0439 \u0441\u043a\u0438\u0434\u043a\u0430 50% \u043f\u0440\u0438 \u043f\u0440\u0435\u0434\u044a\u044f\u0432\u043b\u0435\u043d\u0438\u0438 \u0443\u0434\u043e\u0441\u0442\u043e\u0432\u0435\u0440\u0435\u043d\u0438\u044f", "\u0421\u0442\u043e\u0438\u043c\u043e\u0441\u0442\u044c \u0443\u0441\u043b\u0443\u0433": "\u0435\u0441\u0442\u044c", "\u0422\u0435\u043b\u0435\u0444\u043e\u043d": null, "\u042d\u043b\u0435\u043a\u0442\u0440\u043e\u043d\u043d\u0430\u044f \u043f\u043e\u0447\u0442\u0430": null}, "type": "Feature"}, {"geometry": {"coordinates": [116.763333, 62.182778], "type": "Point"}, "id": 266, "properties": {"\u0410\u0434\u0440\u0435\u0441 \u043c\u0435\u0441\u0442\u043e\u043d\u0430\u0445\u043e\u0436\u0434\u0435\u043d\u0438\u044f": "678282, \u0421\u0443\u043d\u0442\u0430\u0440\u0441\u043a\u0438\u0439 \u0440\u0430\u0439\u043e\u043d, \u0441.\u0422\u043e\u0439\u0431\u043e\u0445\u043e\u0439, \u0443\u043b.\u041e\u043a\u0442\u044f\u0431\u0440\u044c\u0441\u043a\u0430\u044f, 45", "\u0412\u043d\u0443\u0442\u0440\u0435\u043d\u043d\u0438\u0439 \u0438\u0434\u0435\u043d\u0442\u0438\u0444\u0438\u043a\u0430\u0442\u043e\u0440": 266, "\u0412\u0440\u0435\u043c\u044f \u0440\u0430\u0431\u043e\u0442\u044b (\u043f\u043e\u0441\u0435\u0449\u0435\u043d\u0438\u0439)": "\u0422\u043e\u0431\u043e\u0445\u043e\u0439\u0441\u043a\u0438\u0439 \u043c\u0443\u0437\u0435\u0439 \u0431\u0435\u0440\u0435\u0442 \u043d\u0430\u0447\u0430\u043b\u043e \u0441 \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u044f \u0443\u0433\u043e\u043b\u043a\u0430 \u0436\u0438\u0432\u043e\u0439 \u043f\u0440\u0438\u0440\u043e\u0434\u044b (1935) \u0438 \u0448\u043a\u043e\u043b\u044c\u043d\u043e\u0433\u043e \u043a\u0440\u0430\u0435\u0432\u0435\u0434\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u043c\u0443\u0437\u0435\u044f (1936). \u041e\u0441\u043d\u043e\u0432\u0430\u0442\u0435\u043b\u044c \u0413\u0435\u043e\u0440\u0433\u0438\u0439 \u0415\u0432\u0434\u043e\u043a\u0438\u043c\u043e\u0432\u0438\u0447 \u0411\u0435\u0441\u0441\u043e\u043d\u043e\u0432. \u0412 1940 \u0433\u043e\u0434\u0443 \u0432 \u0422\u043e\u0439\u0431\u043e\u0445\u043e\u0435 \u0437\u0430\u043b\u043e\u0436\u0438\u043b\u0438 \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0435 \u0443\u0447\u0435\u0431\u043d\u044b\u0439 \u043e\u043f\u044b\u0442 \u0443\u0447\u0430\u0441\u0442\u043e\u043a. \u0411\u044b\u043b \u0441\u043e\u0437\u0434\u0430\u043d \u0431\u043e\u0442\u0430\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0441\u0430\u0434 - \u043e\u0441\u043e\u0431\u0430\u044f \u0433\u043e\u0440\u0434\u043e\u0441\u0442\u044c \u0422\u043e\u0439\u0431\u043e\u0445\u043e\u0439\u0441\u043a\u0438\u0445 \u044e\u043d\u043d\u0430\u0442\u043e\u0432. \u0432 1960 \u0433\u043e\u0434\u0443 \u043e\u0442\u043a\u0440\u044b\u0442\u0430 \u043a\u0430\u0440\u0442\u0438\u043d\u043d\u0430\u044f \u0433\u0430\u043b\u0435\u0440\u0435\u044f, \u0433\u0434\u0435 \u0441\u043e\u0441\u0440\u0435\u0434\u043e\u0442\u043e\u0447\u0435\u043d\u044b \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d\u0438\u044f \u0436\u0438\u0432\u043e\u043f\u0438\u0441\u0438, \u0441\u043a\u0443\u043b\u044c\u043f\u0442\u0443\u0440\u044b, \u0433\u0440\u0430\u0444\u0438\u043a\u0438, \u043f\u0440\u0438\u043a\u043b\u0430\u0434\u043d\u043e\u0433\u043e \u0438\u0441\u043a\u0443\u0441\u0441\u0442\u0432\u0430. ", "\u0413\u043b\u043e\u0431\u0430\u043b\u044c\u043d\u044b\u0439 \u0438\u0434\u0435\u043d\u0442\u0438\u0444\u0438\u043a\u0430\u0442\u043e\u0440 \u043e\u0431\u044a\u0435\u043a\u0442\u0430": "TOUR-ATTR-266", "\u0414\u0430\u0442\u0430 \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f": null, "\u0414\u043e\u0441\u0442\u0443\u043f\u043d\u043e\u0441\u0442\u044c \u0434\u043b\u044f \u043f\u043e\u0441\u0435\u0449\u0435\u043d\u0438\u044f \u0442\u0443\u0440\u0438\u0441\u0442\u0430\u043c\u0438": "N62\u00b010\u203258\u2033, E116\u00b045\u203248\u2033", "\u041a\u0430\u0442\u0435\u0433\u043e\u0440\u0438\u044f": "\u043c\u0443\u0437\u0435\u0439\u043d\u044b\u0439 \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0441", "\u041c\u0443\u043d\u0438\u0446\u0438\u043f\u0430\u043b\u044c\u043d\u044b\u0439 \u0440\u0430\u0439\u043e\u043d": "\u0421\u0443\u043d\u0442\u0430\u0440\u0441\u043a\u0438\u0439 \u0440\u0430\u0439\u043e\u043d", "\u041d\u0430\u0438\u043c\u0435\u043d\u043e\u0432\u0430\u043d\u0438\u0435": "\"\u0422\u043e\u0439\u0431\u043e\u0445\u043e\u0439\u0441\u043a\u0438\u0439 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0438\u0441\u0442\u043e\u0440\u0438\u043a\u043e-\u043a\u0440\u0430\u0435\u0432\u0435\u0434\u0447\u0435\u0441\u043a\u0438\u0439 \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0441 \u0413.\u0415.\u0411\u0435\u0441\u0441\u043e\u043d\u043e\u0432\u0430", "\u041d\u0430\u043b\u0438\u0447\u0438\u0435 \u0431\u0435\u0437\u0431\u0430\u0440\u044c\u0435\u0440\u043d\u043e\u0439 \u0441\u0440\u0435\u0434\u044b": "\u041f\u043e\u043d\u0435\u0434\u0435\u043b\u044c\u043d\u0438\u043a-\u043f\u044f\u0442\u043d\u0438\u0446\u0430 \u0441 09\u044700\u043c \u0434\u043e 18\u044700\u043c. \u041e\u0431\u0435\u0434\u0435\u043d\u043d\u044b\u0439 \u043f\u0435\u0440\u0435\u0440\u044b\u0432 \u0441 13\u044700\u043c \u0434\u043e 14\u044700\u043c. \u0412\u044b\u0445\u043e\u0434\u043d\u043e\u0439: \u0441\u0443\u0431\u0431\u043e\u0442\u0430, \u0432\u043e\u0441\u043a\u0440\u0435\u0441\u0435\u043d\u044c\u0435", "\u041e\u043f\u0438\u0441\u0430\u043d\u0438\u0435": null, "\u041f\u043e\u0434\u0442\u0432\u0435\u0440\u0436\u0434\u0435\u043d\u0438\u0435 \u043a\u043e\u0440\u0440\u0435\u043a\u0442\u043d\u043e\u0441\u0442\u0438": false, "\u041f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044c, \u0432\u043d\u0435\u0441\u0448\u0438\u0439 \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u0435": null, "\u041f\u0440\u0438\u043c\u0435\u0447\u0430\u043d\u0438\u0435": "\u0432\u0437\u0440-50, \u0448\u043a\u043e\u043b\u044c\u043d\u0438\u043a\u0438-30, \u0434\u0435\u0442\u0438 \u0434\u043e 7 \u043b\u0435\u0442, \u0432\u0435\u0442\u0435\u0440\u0430\u043d\u044b, \u0438\u043d\u0432\u0430\u043b\u0438\u0434\u044b-\u0431\u0435\u0441\u043f\u043b", "\u0421\u0442\u043e\u0438\u043c\u043e\u0441\u0442\u044c \u0443\u0441\u043b\u0443\u0433": "\u043f\u0430\u043d\u0434\u0443\u0441\u044b \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u044e\u0442", "\u0422\u0435\u043b\u0435\u0444\u043e\u043d": null, "\u042d\u043b\u0435\u043a\u0442\u0440\u043e\u043d\u043d\u0430\u044f \u043f\u043e\u0447\u0442\u0430": null}, "type": "Feature"}, {"geometry": {"coordinates": [117.6475, 62.143889], "type": "Point"}, "id": 267, "properties": {"\u0410\u0434\u0440\u0435\u0441 \u043c\u0435\u0441\u0442\u043e\u043d\u0430\u0445\u043e\u0436\u0434\u0435\u043d\u0438\u044f": "678278, \u0421\u0443\u043d\u0442\u0430\u0440\u0441\u043a\u0438\u0439 \u0440\u0430\u0439\u043e\u043d, \u0441.\u0421\u0443\u043d\u0442\u0430\u0440, \u0443\u043b.\u0412\u0438\u043b\u044e\u0439\u0441\u043a\u0430\u044f, 32, 8-411-35-21-1-85, \u044d\u043b. \u0430\u0434\u0440\u0435\u0441: sunmuseum@mail.ru", "\u0412\u043d\u0443\u0442\u0440\u0435\u043d\u043d\u0438\u0439 \u0438\u0434\u0435\u043d\u0442\u0438\u0444\u0438\u043a\u0430\u0442\u043e\u0440": 267, "\u0412\u0440\u0435\u043c\u044f \u0440\u0430\u0431\u043e\u0442\u044b (\u043f\u043e\u0441\u0435\u0449\u0435\u043d\u0438\u0439)": "\u041c\u0443\u0437\u0435\u0439 \u043d\u0430\u0440\u043e\u0434\u043d\u043e\u0433\u043e \u0442\u0432\u043e\u0440\u0447\u0435\u0441\u0442\u0432\u0430 \u0438\u043c\u0435\u043d\u0438 \u0421.\u0410.\u0417\u0432\u0435\u0440\u0435\u0432\u0430 \u043e\u0441\u043d\u043e\u0432\u0430\u043d \u0432 \u0434\u0435\u043a\u0430\u0431\u0440\u0435 1983 \u0433\u043e\u0434\u0443 \u0440\u0435\u0448\u0435\u043d\u0438\u0435\u043c \u0441\u043e\u0432\u043c\u0435\u0441\u0442\u043d\u043e\u0433\u043e \u0437\u0430\u0441\u0435\u0434\u0430\u043d\u0438\u044f \u0420\u041a \u041a\u041f\u0421\u0421 \u0438 \u0440\u0430\u0439\u0441\u043e\u0432\u0435\u0442\u0430. \u0418\u0434\u0435\u0439\u043d\u044b\u0439 \u0432\u0434\u043e\u0445\u043d\u043e\u0432\u0438\u0442\u0435\u043b\u044c \u2013 \u041d\u0430\u0440\u043e\u0434\u043d\u044b\u0439 \u043f\u0438\u0441\u0430\u0442\u0435\u043b\u044c \u042f\u0410\u0421\u0421\u0420 \u0414.\u041a.\u0421\u0438\u0432\u0446\u0435\u0432-\u0421\u0443\u043e\u0440\u0443\u043d \u041e\u043c\u043e\u043b\u043b\u043e\u043e\u043d. \u0412 \u0444\u043e\u043d\u0434\u0435 \u0445\u0440\u0430\u043d\u0438\u0442\u0441\u044f 266 \u0435\u0434.\u0445\u0440. \u041e\u0441\u043d\u043e\u0432\u043d\u043e\u0433\u043e \u0444\u043e\u043d\u0434\u0430, 1718-\u043f\u0440\u0435\u0434\u043c\u0435\u0442\u043e\u0432 \u043d\u0430\u0443\u0447\u043d\u043e-\u0432\u0441\u043f\u043e\u043c\u043e\u0433\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e \u0444\u043e\u043d\u0434\u0430. \u0412 \u043c\u0443\u0437\u0435\u0435 \u0441\u043e\u0441\u0440\u0435\u0434\u043e\u0442\u043e\u0447\u0435\u043d\u044b \u0443\u043d\u0438\u043a\u0430\u043b\u044c\u043d\u044b\u0435 \u0432\u0435\u0449\u0438, \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440\u0438\u0437\u0443\u044e\u0449\u0438\u0435 \u0438\u0441\u0442\u043e\u0440\u0438\u044e, \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b\u044c\u043d\u0443\u044e \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u0443, \u0431\u044b\u0442 \u044f\u043a\u0443\u0442\u0441\u043a\u043e\u0433\u043e \u043d\u0430\u0440\u043e\u0434\u0430. \u042d\u043a\u0441\u043f\u043e\u0437\u0438\u0446\u0438\u044f, \u043f\u043e\u0441\u0432\u044f\u0449\u0435\u043d\u043d\u0430\u044f \u043d\u0430\u0440\u043e\u0434\u043d\u043e\u043c\u0443 \u0438 \u0434\u0435\u043a\u043e\u0440\u0430\u0442\u0438\u0432\u043d\u043e-\u043f\u0440\u0438\u043a\u043b\u0430\u0434\u043d\u043e\u043c\u0443 \u0442\u0432\u043e\u0440\u0447\u0435\u0441\u0442\u0432\u0443, \u0438\u043c\u0435\u0435\u0442 \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u0435 \u0440\u0430\u0437\u0434\u0435\u043b\u044b: \"\u042e\u0432\u0435\u043b\u0438\u0440\u043d\u043e\u0435 \u0438\u0441\u043a\u0443\u0441\u0441\u0442\u0432\u043e\", \"\u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0435 \u0448\u0438\u0442\u044c\u0435\", \"\u0418\u0441\u043a\u0443\u0441\u0441\u0442\u0432\u043e \u0440\u0435\u0437\u044c\u0431\u044b \u043f\u043e \u0434\u0435\u0440\u0435\u0432\u0443\", \"\u0421\u0442\u0430\u0440\u0438\u043d\u043d\u0430\u044f \u0434\u0435\u0440\u0435\u0432\u044f\u043d\u043d\u0430\u044f \u0443\u0442\u0432\u0430\u0440\u044c\".", "\u0413\u043b\u043e\u0431\u0430\u043b\u044c\u043d\u044b\u0439 \u0438\u0434\u0435\u043d\u0442\u0438\u0444\u0438\u043a\u0430\u0442\u043e\u0440 \u043e\u0431\u044a\u0435\u043a\u0442\u0430": "TOUR-ATTR-267", "\u0414\u0430\u0442\u0430 \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f": null, "\u0414\u043e\u0441\u0442\u0443\u043f\u043d\u043e\u0441\u0442\u044c \u0434\u043b\u044f \u043f\u043e\u0441\u0435\u0449\u0435\u043d\u0438\u044f \u0442\u0443\u0440\u0438\u0441\u0442\u0430\u043c\u0438": "N62\u00b09\u203238\u2033, E117\u00b038\u203251\u2033 ", "\u041a\u0430\u0442\u0435\u0433\u043e\u0440\u0438\u044f": "\u043c\u0443\u0437\u0435\u0439\u043d\u044b\u0439 \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0441", "\u041c\u0443\u043d\u0438\u0446\u0438\u043f\u0430\u043b\u044c\u043d\u044b\u0439 \u0440\u0430\u0439\u043e\u043d": "\u0421\u0443\u043d\u0442\u0430\u0440\u0441\u043a\u0438\u0439 \u0440\u0430\u0439\u043e\u043d", "\u041d\u0430\u0438\u043c\u0435\u043d\u043e\u0432\u0430\u043d\u0438\u0435": "\u0421\u0443\u043d\u0442\u0430\u0440\u0441\u043a\u0438\u0439 \u043c\u0443\u0437\u0435\u0439\u043d\u044b\u0439 \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0441 \u0438\u043c.\u0421.\u0410.\u0417\u0432\u0435\u0440\u0435\u0432\u0430-\u041a\u044b\u044b\u043b \u0423\u043e\u043b\u0430 (\u043c\u0443\u0437\u0435\u0439 \u043d\u0430\u0440\u043e\u0434\u043d\u043e\u0433\u043e \u0442\u0432\u043e\u0440\u0447\u0435\u0441\u0442\u0432\u0430)", "\u041d\u0430\u043b\u0438\u0447\u0438\u0435 \u0431\u0435\u0437\u0431\u0430\u0440\u044c\u0435\u0440\u043d\u043e\u0439 \u0441\u0440\u0435\u0434\u044b": "\u041f\u043e\u043d\u0435\u0434\u0435\u043b\u044c\u043d\u0438\u043a-\u043f\u044f\u0442\u043d\u0438\u0446\u0430 \u0441 10\u044700\u043c \u0434\u043e 18\u044700\u043c. \u041e\u0431\u0435\u0434\u0435\u043d\u043d\u044b\u0439 \u043f\u0435\u0440\u0435\u0440\u044b\u0432 \u0441 13\u044700\u043c \u0434\u043e 14\u044700\u043c. \u0412\u044b\u0445\u043e\u0434\u043d\u043e\u0439: \u0441\u0443\u0431\u0431\u043e\u0442\u0430, \u0432\u043e\u0441\u043a\u0440\u0435\u0441\u0435\u043d\u044c\u0435", "\u041e\u043f\u04  \u0411\u044bh\u044b\u0442\u0442\u0430\u04305\u0430\u00bb. \u042d\u043a\u0441\u043f\u043e\u0437\u0438\u0446\u0438\u044f \u043f\u043e\u0441\u0432\u044f\u0449\u0435\u043d\u0430 \u0436\u0438\u0437\u043d\u0438 \u0438 \u0442\u0432\u043e\u0440\u0447\u0435\u0441\u0442\u0432\u0443 \u0432\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043f\u0435\u0432\u0446\u0430-\u0441\u043a\u0430\u0437\u0438\u0442\u0435\u043b\u044f. \u0412 \u043c\u0443\u0437\u0435\u0435 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u044b \u0435\u0433\u043e \u043b\u0438\u0447\u043d\u044b\u0435 \u0432\u0435\u0449\u0438, \u043e\u0440\u0434\u0435\u043d\u0430, \u043c\u0435\u0434\u0430\u043b\u0438, \u0434\u043e\u043a\u0443\u043c\u0435\u043d\u0442\u044b, \u043f\u0435\u0440\u0435\u043f\u0438\u0441\u043a\u0430 \u0441 \u0434\u0435\u044f\u0442\u0435\u043b\u044f\u043c\u0438 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u044b \u0438 \u0438\u0441\u043a\u0443\u0441\u0441\u0442\u0432\u0430. \u0412\u0441\u0435\u0433\u043e \u0445\u0440\u0430\u043d\u0438\u0442\u0441\u044f 785 \u043f\u0440\u0435\u0434\u043c\u0435\u0442\u043e\u0432 \u043e\u0441\u043d\u043e\u0432\u043d\u043e\u0433\u043e, 530 \u043d\u0430\u0443\u0447\u043d\u043e-\u0432\u0441\u043f\u043e\u043c\u043e\u0433\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e \u0444\u043e\u043d\u0434\u043e\u0432.", "\u0413\u043b\u043e\u0431\u0430\u043b\u044c\u043d\u044b\u0439 \u0438\u0434\u0435\u043d\u0442\u0438\u0444\u0438\u043a\u0430\u0442\u043e\u0440 \u043e\u0431\u044a\u0435\u043a\u0442\u0430": "TOUR-ATTR-269", "\u0414\u0430\u0442\u0430 \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f": null, "\u0414\u043e\u0441\u0442\u0443\u043f\u043d\u043e\u0441\u0442\u044c \u0434\u043b\u044f \u043f\u043e\u0441\u0435\u0449\u0435\u043d\u0438\u044f \u0442\u0443\u0440\u0438\u0441\u0442\u0430\u043c\u0438": "N62\u00b09\u203238\u2033, E117\u00b038\u203251\u2033 ", "\u041a\u0430\u0442\u0435\u0433\u043e\u0440\u0438\u044f": "\u043c\u0443\u0437\u0435\u0439\u043d\u044b\u0439 \u043a\
